_objectMoved(JSObject* obj, JSObject* old)
{
  mozilla::dom::PerformanceTiming* self = UnwrapPossiblyNotInitializedDOMObject<mozilla::dom::PerformanceTiming>(obj);
  if (self) {
    UpdateWrapper(self, self, obj, old);
  }

  return 0;
}

